import { PLAYLIST_INFO } from './actionTypes';

const initState ={
    playlist: null
}

export default (state = initState, action) =>{
    switch (action.type) {
        case PLAYLIST_INFO:{
            console.log(123);
            return {
                ...state,
                playlist: action.payload,
                isFetching: true
            }
        }

        default:
            return {
                ...state,
            }
    }
}
